class AppState {
    constructor() {
        this.state = {
            username: "",
            password:""

        }
    }

    getLoggedUser() {
        return this.state.loggedUserneame.username;
    }

    setCredentials(username, password) {
        this.state.username = username
        this.state.password = password
    }
}
const AppInstance = new AppState();
export default AppInstance;
